import React from 'react';
import './Banner.css';  // File CSS style cho ảnh bìa

function Banner() {
  return (
    <div className="Navbar">
      <div className="banner-content">
        <h1>Quản Lý Đồng Hồ</h1>
        <p>Trang quản lý sản phẩm đồng hồ chuyên nghiệp</p>
      </div>
    </div>
  );
}

export default Banner;
